import React from 'react';
import { Row, Col, Menu } from 'antd';
import { BarsOutlined } from '@ant-design/icons';

const AppLayout = ({ children }) => {
    return (
        <>
            <Menu>

            </Menu>
            <Row gutter={[8, 8]}>
                <Col md={5}>
                <BarsOutlined size="20px" />
                
                </Col>

                <Col md={14}>
                    {children}
                </Col>

                <Col md={5}>

                </Col>
            </Row>
        </>
    )
}

export default AppLayout;
